function ItemPass()

    -- gg.setVisible(false)
    gg.clearResults()
    gg.setRanges(gg.REGION_C_ALLOC)
    -- gg.getValues({{address = 0xABCDEF12, flags = gg.TYPE_DWORD}})
    gg.searchNumber("1599361808;65537;1599099674:449", gg.TYPE_DWORD) --
    gg.refineNumber("1599361808", gg.TYPE_DWORD)
    n = gg.getResultCount()
    jz = gg.getResults(n)

    for i = 1, n do
        local edits = {
            {address = jz[i].address - 8, flags = gg.TYPE_DWORD, value = 0},
            {address = jz[i].address - 12, flags = gg.TYPE_DWORD, value = 0},
            {address = jz[i].address - 16, flags = gg.TYPE_DWORD, value = 0}, {
                address = jz[i].address - 0x1D0,
                flags = gg.TYPE_DWORD,
                value = 0,
                freeze = true
            }, {
                address = jz[i].address - 0x1CC,
                flags = gg.TYPE_DWORD,
                value = 0,
                freeze = true
            }, {
                address = jz[i].address - 0x1C8,
                flags = gg.TYPE_DWORD,
                value = 0,
                freeze = true
            }
        }

        -- edit nilainya langsung di memory
        gg.setValues(edits)

        -- tambahkan ke list biar terlihat / freeze aktif
        gg.addListItems(edits)
    end

    gg.clearResults()
end

