function GiveCard()
    gg.alert(
        "Before running this, make sure the card limit is already active, meaning you can no longer send cards.")

    function menuUtama()
        local menu = gg.choice({
            "1ï¸âƒ£ Unlimited Send", "2ï¸âƒ£ Send Gold Card", "âŒ Keluar"
        }, nil, "Pilih Menu:")

        if menu == 1 then
            menuPertama()
        elseif menu == 2 then
            menuKedua()
        elseif menu == 3 or menu == nil then
            os.exit()
        end
    end

    -- ============================
    -- MENU 1
    -- ============================
    function menuPertama()
        gg.clearResults()
        gg.setVisible(false)
        gg.setRanges(gg.REGION_C_ALLOC)
        gg.searchNumber("65537;1918984974;65537::449", gg.TYPE_DWORD)
        gg.refineNumber("1918984974", gg.TYPE_DWORD)
        local res = gg.getResults(2000)
        if #res == 0 then return end
        local final = {}
        for i, v in ipairs(res) do
            local base = v.address
            local off34 = base + 0x34
            local off3c = base + 0x3C
            local off44 = base + 0x44
            local r = gg.getValues({
                {address = off34, flags = gg.TYPE_DWORD},
                {address = off3c, flags = gg.TYPE_DWORD},
                {address = off44, flags = gg.TYPE_DWORD}
            })
            local val34 = r[1].value
            local val3c = r[2].value
            local val44 = r[3].value
            local xorCheck = bit32.bxor(val34, val3c)
            if xorCheck == 0 then

                table.insert(final, {
                    address = off3c,
                    flags = gg.TYPE_DWORD,
                    value = 0,
                    freeze = true
                })
            end
        end

        if #final > 0 then
            gg.setValues(final)
            gg.addListItems(final)
            gg.toast("âœ“ Freeze.")
            gg.clearResults()
        else
        end

        gg.clearResults()
