function gandumkereta()
    gg.clearResults()
    gg.clearList()
    gg.setVisible(false)
    -- SEARCH BASE
    gg.searchNumber("1701314560;1684368227;13663", gg.TYPE_DWORD)
    gg.toast("Search selesai")

    -- REFINE
    gg.refineNumber("1701314560", gg.TYPE_DWORD)
    gg.toast("Refine selesai")

    -- SIMPAN BASE ADDRESS
    local baseResults = gg.getResults(50)
    if #baseResults == 0 then
        gg.alert("âŒ Base address tidak ditemukan")
        os.exit()
    end

    --------------------------------------------------
    -- PART 1 : TIMER FLOAT 1C8
    --------------------------------------------------

    local offset = 0x1C8

    local MIN_TIME = 1800
    local MAX_TIME = 18000
    local MIN_TIME_ALT = 1
    local MAX_TIME_ALT = 10

    local readList = {}
    for i, v in ipairs(baseResults) do
        table.insert(readList,
                     {address = v.address + offset, flags = gg.TYPE_FLOAT})
    end

    local values = gg.getValues(readList)

    local function filterValues(minVal, maxVal, label)
        local list = {}
        for i, v in ipairs(values) do
            if v.value >= minVal and v.value <= maxVal then
                table.insert(list, {
                    address = v.address,
                    flags = gg.TYPE_FLOAT,
                    value = 1,
                    name = string.format(
                        "FLOAT 1 | %s | Base 0x%X + 0x1C8 | Old: %.2f", label,
                        baseResults[i].address, v.value)
                })
            end
        end
        return list
    end

    local editFloat = filterValues(MIN_TIME, MAX_TIME, "30m-5h")
    if #editFloat == 0 then
        gg.toast("âš ï¸ Tidak ketemu 30m-5h, coba 1-10 detik")
        editFloat = filterValues(MIN_TIME_ALT, MAX_TIME_ALT, "1s-10s")
    end

    if #editFloat == 0 then
        gg.alert("âŒ Timer tidak ditemukan")
        os.exit()
    end

    gg.setValues(editFloat)
    gg.addListItems(editFloat)

    ------------------------- baseResults sudah kamu dapat dari search sebelumnya

    local gerbongOffsets = {-0x668, -0x540, -0x418, -0x2F0, -0x1C8}

    local dwordValues = {1701345034, 1677751393, 13151, 0, 0, 0, 0, 1}
    local editList = {}
    local addList = {}

    for _, base in ipairs(baseResults) do
        local floatAddr = base.address + 0x1C8

        -- FLOAT hanya untuk ditampilkan
        table.insert(addList, {
            address = floatAddr,
            flags = gg.TYPE_FLOAT,
            name = string.format("FLOAT", base.address)
        })

        for _, off in ipairs(gerbongOffsets) do
            local startAddr = floatAddr + off

            -- 8 DWORD
            for i = 0, 7 do
                table.insert(editList, {
                    address = startAddr + (i * 4),
                    flags = gg.TYPE_DWORD,
                    value = dwordValues[i + 1],
                    name = string.format("Gerbong", off,
                                         i + 1)
                })
            end

            -- +0x48 â†’ 1
            table.insert(editList, {
                address = startAddr + 0x48,
                flags = gg.TYPE_DWORD,
                value = 1,
                name = string.format("Gerbong", off)
            })
        end
    end

    -- hanya yang ada value saja yang di-set
    gg.setValues(editList)

    -- semua dimasukkan ke Address List
    gg.addListItems(addList)
    gg.addListItems(editList)

    gg.toast(
        "âœ… Error hilang, karena semua setValues sekarang punya field 'value'")

end

function duplicateCard()
    gg.clearResults()
    gg.clearList()
    gg.setVisible(false)

    -- Cari dua nilai sekaligus: 1918984974 atau 1918984976
    gg.searchNumber("1918984974;1918984976", gg.TYPE_DWORD)
    local results = gg.getResults(99999)

    local edits = {}

    for i, v in ipairs(results) do
        local base = v.address

        -- Ambil nilai offset yang dibutuhkan
        local check = gg.getValues({
            {address = base + 0x18, flags = gg.TYPE_DWORD}, -- 1
            {address = base + 0x1C, flags = gg.TYPE_DWORD} -- 2
            -- {address = base + 0x20, flags = gg.TYPE_DWORD}, -- 0
            -- {address = base + 0x24, flags = gg.TYPE_DWORD}  -- 0
        })

        local v18 = check[1].value
        private_1C = check[2].value
        -- local v20 = check[3].value
        -- local v24 = check[4].value

        -- Validasi nilai
        local validRange = (v18 >= 1 and v18 <= 100) or
                               (private_1C >= 1 and private_1C <= 100)
        -- local validZero  = (v20 == 0) and (v24 == 0)

        -- Jika semua valid â†’ edit
        if validRange then
            table.insert(edits, {
                address = base + 0x18,
                flags = gg.TYPE_DWORD,
                value = 500
            })

            table.insert(edits, {
                address = base + 0x1C,
                flags = gg.TYPE_DWORD,
                value = 500
            })
        end
    end

    -- Terapkan semua edit
    if #edits > 0 then
        gg.setValues(edits)
        gg.toast("Sukses! Semua offset valid telah diedit.")
    else
        gg.toast("Tidak ada struktur yang memenuhi validasi.")
    end

end

